import { createGlobalStyle } from 'styled-components';

const GlobalStyles = createGlobalStyle`
    * {
        margin: 0;
        padding: 0;
        font-family: 'Montserrat', 'sans-serif';
    }
    body {
        color: #fffcf2;
    }
`
export default GlobalStyle;
